import styled from "styled-components";

export const Wrapper = styled.div`

    color: var(--white);
    background: var(--darkGrey);
    border-radius: 20px;
    padding: 5px;
    text-align: center;

    h3{
        mar
    }

`;

export const Image = styled.img`



`;
